import React, { Component } from 'react';
import * as d3 from 'd3';
//import { Link } from 'react-router-dom';
import { Tab } from 'semantic-ui-react';
import './TabView.css';

/*const panes = [
    { menuItem: 'Force Display', render: () => <Tab.Pane>Force Display</Tab.Pane> },
    { menuItem: 'Bar Display', render: () => <Tab.Pane>Bar Display</Tab.Pane> },
]*/

class TabView extends Component {

    panes = [
        { 
            menuItem:   'Force Display', 
                        render: () => <Tab.Pane>{this.force}</Tab.Pane> 
        },
        { 
            menuItem:   'Bar Display', 
                        render: () => <Tab.Pane>Bar Display</Tab.Pane> 
        }
    ];

    force = () => {
        return (
            <div>
                <p>Force Display</p>
            </div>
        );
    }

    render () {

        return (
            <div>
                <Tab panes={this.panes} />
                {this.force}
            </div>
        );
    }

}
export default TabView;
